import React from "react";
import { Modal, Form, Input, InputNumber } from "antd";

const CustomModal = ({ visible, onCancel, onOk }) => {
  return (
    <Modal
      centered
      iconType="question"
      closable={false}
      visible={visible}
      onCancel={onCancel}
      onOk={onOk}
    ></Modal>
  );
};

export default CustomModal;
